import React from 'react'

import './header.css'
import ic_import_contacts_prim from '../assets/import_contacts-prim.svg'
import ic_book_read from '../assets/boo-read-prim.svg'
import ic_search_prim from '../assets/search-prim.svg'

export const Header = (props) => {
  return (
  <div className="debug header">
    <div className="icon-container-header">
      <img src={ic_search_prim}/>
    </div>
    <h2>{props.title}</h2>
  </div>
  )
}


